    public class AppData : INotifyPropertyChanged
    {
        // Module version
        private string m_version;
        public string Version
        {
            get { return m_version; }
            set { m_version = value; OnPropertyChanged("Version"); }
        }

        // Module title
        private string m_title;
        public string Title
        {
            get { return m_title; }
            set { m_title = value; OnPropertyChanged("Title"); }
        }

        // Module name
        private string m_name;
        public string Name
        {
            get { return m_name; }

            // We force the name value to lower here. Could be revised in the future
            set { m_name = value; OnPropertyChanged("Name"); }
        }

        // Zim file path 
        internal string m_zimPath;
        public string ZimPath
        {
            get { return Path.GetFileName(m_zimPath);  }
            set { m_zimPath = value; OnPropertyChanged("ZimPath"); }
        }

        // Logo file path
        internal string m_logoPath;
        public string LogoPath
        {
            get { return Path.GetFileName(m_logoPath); }
            set { m_logoPath = value; OnPropertyChanged("LogoPath"); }
        }

        // Module description paragraph
        private string m_description;
        public string Description
        {
            get { return m_description; }
            set { m_description = value; OnPropertyChanged("Description"); }
        }

        private int m_languageIndex;

        public int LanguageIndex {
            get { return m_languageIndex; }
            set { m_languageIndex = value; }
        }

        // Language Combobox Dropdown Collection
        private ObservableCollection<Tuple<string,string>> m_languages;
        public ObservableCollection<Tuple<string, string>> Languages
        {
            get { return m_languages; }
            set { m_languages = value;  }
        }

        private int m_linkListIndex;

        public int LinkListIndex {
            get { return m_linkListIndex; }
            set { m_linkListIndex = value; }
        }

        // Property changed event handler for updating UI
        public event PropertyChangedEventHandler PropertyChanged;

        // Constructor
        public AppData()
        {
            Reset();
            initLanguages();
        }

        // Handles changes to properties
        protected void OnPropertyChanged([CallerMemberName] string name = null)
        {
            PropertyChanged?.Invoke(this, new PropertyChangedEventArgs(name));
        }

        // Reset out values. Trigger by a user reset click
        public void Reset()
        {
            Version     = string.Empty;
            Title       = string.Empty;
            Name        = string.Empty;
            ZimPath     = "Click + to add a ZIM file";
            LogoPath    = "Click + to add a logo file";
            Description = string.Empty;
            LanguageIndex = 0;
            LinkListIndex = 0;
        }

