        // Check our data for issues before a module build
        public bool CheckArgs()
        {
            // Check if the logo path is empty
            if (m_logoPath == string.Empty)
            {
                System.Windows.MessageBox.Show("Please select a logo for your module");
                return false;
            }

            if (LogoPath == "Click + to add a logo file") {
                System.Windows.MessageBox.Show("Please select a logo for your module");
                return false;
            }

            // Check that the logo still exists at this path
            if (!File.Exists(m_logoPath))
            {
                System.Windows.MessageBox.Show("The selected logo no longer exists. Please select a new logo");
                m_logoPath = string.Empty;
                return false;
            }

            // Make sure the zim path isn't empty
            if (m_zimPath == string.Empty)
            {
                System.Windows.MessageBox.Show("Please select a ZIM file");
                return false;
            }

            // Make sure the zim path isn't empty
            if (m_zimPath == "Click + to add a ZIM file")
            {
                System.Windows.MessageBox.Show("Please select a ZIM file for your module");
                return false;
            }

            // Check that the zim still exists at this path
            if (!File.Exists(m_zimPath))
            {
                System.Windows.MessageBox.Show("The provided ZIM file no longer exists. Please select a new ZIM file");
                m_zimPath = string.Empty;
                return false;
            }

            // Check that the version string isn't empty
            if (m_version == string.Empty)
            {
                System.Windows.MessageBox.Show("Please set a version number for your module");
                return false;
            }

            // Check that the title string isn't empty
            if (m_title == string.Empty)
            {
                System.Windows.MessageBox.Show("Please set a title for your module");
                return false;
            }

            // Check that the name string isn't empty
            if (m_name == string.Empty)
            {
                System.Windows.MessageBox.Show("Please set a name for your module. ");
                return false;
            }

            // Check that the description string isn't empty
            if (m_description == string.Empty)
            {
                System.Windows.MessageBox.Show("Please set a description for your module");
                return false;
            }

            // Passed all checks
            return true;
        }

        // Build a preview for viewing only. Not accurate output
