            html += "<h2><a href=\"\">" + m_title + "</a></h2>";
            html += "<p>" + description + "</p>";
            html += "</div>";
            // End of Kiwix module

            // End of content
            html += "</div>";
            html += "<div class=\"menubar cf\" style=\"margin-bottom: 80px; position: relative;\">";
            html += "<ul>";
            html += "<li><a href=\"\">HOME</a></li>";
            html += "<li><a href=\"\">ABOUT</a></li>";
            html += "</ul>";
            html += "</div>";
            html += "</body>";
            html += "</html>";

            // return our string 
            return html;
        }

        // Builds our final rachel-index.php into a list of strings
        // Will likely use a template file in the future
        public List<string> BuildIndex() 
        {
            // Empty list where our individual lines will be added
            var lines = new List<string>();
            lines.Add("<!-- version=" + m_version + " -->");
            lines.Add("");
            lines.Add("<div class=\"indexmodule\">");
            lines.Add("  <?php");
            lines.Add("    $name    =\"" + m_name + "\";");
            lines.Add("    $title   =\"" + m_title + "\";");
            lines.Add("    $host    =\"//$_SERVER[SERVER_ADDR]:81\";");
            lines.Add("    $zim     =\"" + Path.GetFileNameWithoutExtension(m_zimPath) + "\";");
            lines.Add("    $baseurl =\"$host/$zim\";");
            lines.Add("  ?>");
            lines.Add("");
            lines.Add("  <form action=\"<?php echo $host ?>/search\" id=\"<?php echo $name ?>-search-form\">");
            lines.Add("    <div>");
            lines.Add("      <input type=\"text\" id=\"<?php echo $name ?>-search-box\" name=\"pattern\" value=\"\" autocomplete=\"off\">");
            lines.Add("      <input type=\"submit\" name=\"search\" value=\"🔍\">");
            lines.Add("      <input type=\"hidden\" name=\"content\" value=\"<?php echo $zim ?>\">");
            lines.Add("    </div>");
            lines.Add("  </form>");
            lines.Add("");
            lines.Add("  <script>");
            lines.Add("    $(function() {");
            lines.Add("      $(\"#<?php echo $name ?>-search-box\").autocomplete({");
            lines.Add("        source: \"<?php echo $host ?>/suggest?content=<?php echo $zim ?>\",");
            lines.Add("        dataType: \"json\",");
            lines.Add("        cache: false,");
            lines.Add("        select: function(event, ui) {");
            lines.Add("          $(\"#<?php echo $name ?>-search-box\").val(ui.item.value);");
            lines.Add("          $(\"#<?php echo $name ?>-search-form\").submit();");
            lines.Add("        },");
            lines.Add("      });");
            lines.Add("    });");
            lines.Add("  </script>");
            lines.Add("");
            lines.Add("  <a href=\"<?php echo $baseurl ?>/\"><img src=\"<?php echo $dir ?>/logo.png\" alt=\"<?php echo $title ?>\"></a>");
            lines.Add("  <h2><a href=\"<?php echo $baseurl ?>/\"><?php echo $title ?></a></h2>");
            lines.Add("  <p>" + m_description + "</p>");
            lines.Add("</div>");

            // return the lines
            return lines;
        }

        // Converts an image to base64 for our preview string
        private string image_to_base64(string file_path)
        {
            byte[] imageArray = System.IO.File.ReadAllBytes(file_path);
            return Convert.ToBase64String(imageArray);
        }
    }
